import React from "react";
import "./Login.css";
import bannerImage from "./images/amazon-logo_PNG11.png";
import { Link } from "react-router-dom";

function Login() {
	return (
		<div>
			<Link to="/">
				<img src={bannerImage} />
			</Link>
		</div>
	);
}

export default Login;
